import React, { useState } from "react";
import "./Home.css";
import { Link, Routes, Route, useNavigate } from 'react-router-dom';
import Personality from "./Personality";

const Home = () => {
  const navigate = useNavigate();
  const [selectedHoroscope, setSelectedHoroscope] = useState('');
  const [showDropdown, setShowDropdown] = useState(false);

  function handleHoroscopeSelect(horoscope) {
    setSelectedHoroscope(horoscope);
    setShowDropdown(false); // Close the dropdown after selecting a horoscope
  }

  function handleClick(event) {
    event.preventDefault();
    navigate("/personality");
    console.log(selectedHoroscope);
  }

  return (
    <React.Fragment>
      <Link to="/personality"></Link>
      <Routes>
        <Route path="/personality" element={<Personality />} />
      </Routes>
      <div className='main-container'>
        <span className='text'>Find your match</span>
        <div className='wrapper-2'>
          <span className='text-2'>
            We match compatibility based on:
            <br />
            Personality
            <br />
            Aestheticism
            <br />
            Lifestyle
          </span>
        </div>
        <span className='text-3'>Horoscope</span>
        <form>
          <div className="form-group">
            <div className="menu-container">
              <div className="menu-trigger">
                <button onClick={() => 
                  <div className="dropdown-horoscope">
                    <ul>
                      <h3>Your Horoscope</h3>
                      <DropdownItem text="Aries" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Taurus" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Gemini" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Cancer" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Leo" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Virgo" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Libra" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Scorpio" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Sagittarius" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Capricorn" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Aquarius" onSelect={handleHoroscopeSelect} />
                      <DropdownItem text="Pisces" onSelect={handleHoroscopeSelect} />
                    </ul>
                  </div>
                } className="btn_text">
                Your Horoscope
              </button>
              </div>
            </div>
          </div>
          <button onClick={handleClick} className="btn_text">
            Lets go !!
          </button>
        </form>
      </div>
    </React.Fragment>
  );
};

const DropdownItem = ({ text, onSelect }) => {
  return (
    <li className="dropdownItem" onClick={() => onSelect(text)}>
      <span>{text}</span>
    </li>
  );
};

export default Home;
